package com.iktpreobuka.dnevnik.entities.dto;

public class MarkDTOF {
	
	private Integer markValue;
	
	private String note;
	
	private String markEarned;
	
	private Integer markTypeId;

	public MarkDTOF() {
		super();
		// TODO Auto-generated constructor stub
	}

	public Integer getMarkValue() {
		return markValue;
	}

	public void setMarkValue(Integer markValue) {
		this.markValue = markValue;
	}

	public String getNote() {
		return note;
	}

	public void setNote(String note) {
		this.note = note;
	}

	public String getMarkEarned() {
		return markEarned;
	}

	public void setMarkEarned(String markEarned) {
		this.markEarned = markEarned;
	}

	public Integer getMarkTypeId() {
		return markTypeId;
	}

	public void setMarkTypeId(Integer markTypeId) {
		this.markTypeId = markTypeId;
	}

	
	
	
	
	
}
